        tag: 'angel',
    },
    {
        id: '4' ,
        imageName: image4,
        tag: 'devil',
    },
    {
        id: '5' ,
        imageName: image5,
        tag: 'devil',
    },
    {
        id: '6' ,
        imageName: image6,
        tag: 'devil',
    },
    {
        id: '7' ,
        imageName: image7,
        tag: 'war',
    },
    {
        id: '8' ,
        imageName: image8,
        tag: 'war',
    },
    {
        id: '9' ,
        imageName: image9,
        tag: 'war',
    },
    {
        id: '10' ,
        imageName: image10,
        tag: 'angel',
    }
]

export default GalleryData;
<Lightbox GalleryData={images} />;
